import React from "react";
import { NavLink } from "react-router-dom";
import FindStock from "./FindStock";

const Navbar = () => {
  return (
    <div className="navbarContainer">
      <div className="navbarHomePageButton"> Stock Tracker </div>
      <div className="navbarFindStockButton">
        <NavLink to={FindStock}> Find Stocks </NavLink>
      </div>
    </div>
  );
};

export default Navbar;
